import React, { useEffect } from 'react'
import { useState } from 'react'

const Home = () => {
  const [exercisesSessions, setExercisesSessions] = useState([])

  const getExercisesSessions = useCallback(async () => {
    await fetch('http://localhost:8000/api/exercisesSessions/1')
            .then(res => res.json())
            .then(data => setExercisesSessions(data))
  }, [])

  useEffect(() => {
    getExercisesSessions()
      .catch(console.error)

  }, [getExercisesSessions])

  return (
    <div>Home</div>
  )
}

export default Home
